import React from "react";
import BackButton from "./Buttons/BackButton";
import Zoom from "@material-ui/core/Zoom";
import UpButton from "./Buttons/UpButton";
import { MainDiv, StyledPaper, Text } from "./styles/ContentPages";
import {
  ProjectPaper,
  TextDiv,
  ProjectTitle,
  ProjectText
} from "./styles/Projects";

export default function Bio(props) {
  return (
    <MainDiv>
      <BackButton onClick={() => props.transition("MENU")} />
      <Zoom in={true}>
        <StyledPaper>
          <ProjectPaper elevation={12}>
            <TextDiv>
              <ProjectTitle>EDUCATION</ProjectTitle>
              <ProjectText>
                <strong>Diploma: Full Stack Web Development</strong> <br/>
                LIGHTHOUSE LABS <br/>
                Graduated in February 2020
                <br />
                <strong>Master of Science (MSc) in Reproductive Physiolog</strong> <br/>
                University of Toronto <br/>
                Research-based degree, Thesis Title: Role of Acid Sphingomyelinase in Murine Placentation <br/>
                <strong>SYSTEMS, CMS & DATABASES: </strong> <br/>
                PostgresSQL, MongoDB, Git <br/>
                <strong>TESTING:</strong> <br/>
                Jest, Storybook, Cypress, Mocha/ Chai, RSpec
              </ProjectText>
            </TextDiv>
          </ProjectPaper>
          <UpButton onClick={() => props.scrollUp()} />
        </StyledPaper>
      </Zoom>
    </MainDiv>
  );
}
